    // Call the onSearch prop function with the entered student_ID
    onSearch(student_ID);
  }

  return (
    <div>
      <Form>
        <Row>
          <Col>
            <Input
              id="Txt"
              name="text"
              placeholder="Enter ID Number"
              type="text"
              // Remove the value and onChange
            />
          </Col>
          <Col>
            <Button style={{ backgroundColor: "#419197" }} onClick={handleSearch}>
              {/* Your search button content */}
            </Button>
          </Col>
        </Row>
      </Form>
    </div>
  );
}

export default Search;
